import {Link} from "react-router-dom";

const PRODUCTS = [
    {id: 1, name: "Product 1"},
    {id: 2, name: "Product 2"},
    {id: 3, name: "Product 3"},
];

function Products() {
    return (<>
            <h1>Some products</h1>
            <ul>
                <Link to='/products/1'>Product 1</Link>
                <Link to='/products/2'>Product 2</Link>
                <Link to='/products/3'>Product 3</Link>
            </ul>
        </>)
}

export default Products;
